import "antd/dist/antd.css";
import { Layout, Divider, Table } from "antd";
import React from "react";
import "./accesslog.css";
import Sidebar from "../../components/sidebar/Sidebar";
const { Content } = Layout;

const columns = [
  {
    title: "Browser",
    dataIndex: "browser",
  },
  {
    title: "IP",
    dataIndex: "ip",
  },
  {
    title: "Time",
    dataIndex: "time",
  },
];
const data = [
  {
    key: "1",
    browser: "Chrome on Window",
    ip: "192.149.122.128",
    time: "	11:34 PM",
  },
  {
    key: "2",
    browser: "Mozilla on Window",
    ip: "86.188.154.225",
    time: "June 20, 2022  10:34 PM",
  },
  {
    key: "3",
    browser: "Chrome on iMac",
    ip: "192.149.122.128",
    time: "June 18, 2022  08:56 PM",
  },
  {
    key: "4",
    browser: "Chrome on Window",
    ip: "192.149.122.128",
    time: "June 15, 2022 04:29 PM",
  },
  {
    key: "5",
    browser: "Chrome on Window",
    ip: "192.149.122.128",
    time: "	11:34 PM",
  },
];

const Accesslog = () => {
  const handleMenuClick = (menu) => {
    console.log("Profile");
  };
  return (
    <Layout className="Container">
      <Sidebar handleClick={handleMenuClick} />
      <Layout className="accesslog-container">
        <div className="accesslog-header">
          <h3>Login Activity</h3>
          <p>Here is your last 20 login activities log.</p>
        </div>
        <Content
          className="site-layout-background"
          style={{
            margin: "0 8.4rem 3rem 2.8rem",
            minHeight: 280,
          }}
        >
          <div>
            <Divider />
            <Table pagination={false} columns={columns} dataSource={data} />
          </div>
        </Content>
      </Layout>
    </Layout>
  );
};

export default Accesslog;
